import React from 'react'
import { Button, Form, FormGroup, Label, Input } from 'reactstrap';

class SignIn extends React.Component {

  render() {
    return (
        <Form>
            <h1>Flight School</h1>
            <h2>Log In</h2>
            <FormGroup>
                <Label>Email</Label>
                <Input type="email" placeholder="Email" />
            </FormGroup>
        </Form>
    )
  }
}

export default SignIn
